import React, { Component } from "react";
import MainBookPage from "./components/MainBookPage";
import "./App.css";
import Navbar from "../containers/Navbar";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <MainBookPage />
      </div>
    );
  }
}

export default App;
